import React from 'react';
import ReactDOM from 'react-dom/client';

import App from './App';
import { WeatherProvider } from './WeatherContext';


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <WeatherProvider>
    <App />
    </WeatherProvider>
  </React.StrictMode>
);


// WeatherProvider'ı projenizin en üst düzey bileşeni içinde kullanarak, bu global state'i tüm uygulama boyunca kullanılabilir hale getirebilirsiniz.
